INSERT INTO `t_base_terms` VALUES ('2023062814265601','用户登录-服务条款','# 服务条款\n\n## 一、条款的范围与确认\n\n1. 本条款中的“产品服务”指梁惠涌向用户提供的 **HuiYong**（[https://huiyong.online](https://huiyong.online)）上所展示的服务功能，具体服务内容以您所使用或订购的内容为准。\n2. 本条款有助于您了解本平台的服务内容及用户的使用权利、义务，请您仔细阅读本条款（特别是以粗体标注的内容）。在接受本条款之前，请您仔细阅读全部内容，如您无法准确理解或不同意本条款的任一内容，请不要进行后续操作。\n3. 通过网络页面点击确认、实际购买、使用我们提供的服务等操作，或以其他方式选择接受本条款的，即表示您同意并接受本条款的全部内容。\n4. 由于互联网行业的高速发展，本条款列明的条款未必能完整罗列并覆盖您与本平台的所有权利与义务，现有的约定也不能保证完全符合未来发展的需求。因此，本平台有权在后续运营中对本条款做任何修改和补充，并将在修改补充后再次将其公示以便获得您的确认。对于服务条款、隐私政策或规则的修改将在公布时或规定的生效日立即生效。\n5. 若您在新的条款生效后访问和使用本平台产品服务，视为您同意接受修订后的服务条款。若您不同意变更修改后的条款内容，您有权停止使用相关服务、删除您在即时设计/即时原型上有关账户信息中的内容等方式来终止服务条款。\n6. 如果您代表某个机构而非您个人注册、登录及使用本平台产品服务，则您将被认为已获得充分授权代表该机构同意本条款以及本条款后续的修改和补充。\n\n## 二、账号注册与安全\n\n1. 您在使用本平台产品服务前需要注册本平台帐号。您须对注册信息的真实性、合法性、有效性承担全部责任，并配合我们依法核验您的注册信息；您不得未经授权代表他人或冒充他人；您也不得利用他人的名义发布任何信息或恶意使用注册帐号导致其他用户误认。\n2. 您有责任妥善保管注册帐号及密码信息的安全，您需要对注册帐号项下的行为承担法律责任。因您的原因造成的账户、密码等信息被冒用、盗用或非法使用，由此引起的一切风险、责任、损失、费用等应由您自行承担。\n3. 您在注册帐号中设置的用户名、头像、个人介绍等必须遵守法律法规、公序良俗、社会公德，且不会侵害其他第三方的合法权益，否则我们可能会取消您的用户名、头像、个人介绍。\n4. 如您发现有他人冒用或盗用您的帐号，请您立即以有效方式通知我们，您也可以向我们申请暂停或终止本平台产品服务。\n\n## 三、用户使用相关规则\n\n1. 您应遵守中华人民共和国相关法律法规及您所属、所居住的国家或地区的法律法规，不得将本平台产品或服务用于任何非法目的，也不得以任何非法方式使用本平台产品或服务，如有违反，其所有造成的法律责任、结果损失和相关赔偿均由用户本人自行承担。\n2. 您理解并同意，即时设计一直致力于为用户提供文明健康、规范有序的网络环境，您不得利用即时设计制作、复制、发布、传播任何违法违规内容，包括但不限于：\n- 反对宪法所确定的基本原则的；\n- 危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一，损害国家荣誉和利益的；\n- 煽动民族仇恨、民族歧视、破坏民族团结的；\n- 破坏国家宗教政策，宣扬邪教和封建迷信的；\n- 散布谣言，扰乱社会秩序，破坏社会稳定的；\n- 散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的；\n- 侮辱或者诽谤他人，侵害他人合法权利的；\n- 含有虚假、诈骗、有害、胁迫、侵害他人隐私、骚扰、侵害、中伤、粗俗、猥亵、或其它道德上令人反感的内容；\n- 侵犯他人隐私、个人信息、著作权、商标权等知识产权或合法权利的内容；\n- 散布烟草、酒精、药物、整容、医疗保健品类的商业广告，或类似的商业招揽信息，散布过度营销信息及垃圾信息；\n- 含有中国法律、法规、规章、条例以及任何具有法律效力之规范所限制或禁止的其它内容的或含有即时设计认为不适合展示的内容。\n3. 您承诺发送或传播的内容应有合法来源，相关内容为您所有或您已获得权利人的授权。\n4. 您不得使用未经授权的插件、外挂或第三方工具对本条款项下的服务进行干扰、破坏、修改或施加其他影响。\n5. 您不得对本平台产品系统和程序采取反向工程手段进行破解，不得对上述系统和程序（包括但不限于源程序、目标程序、技术文档、服务器数据）进行复制、修改、编译、整合或篡改，不得修改或增减本平台产品系统的任何功能，如有违反，本平台将保留依法追究相关责任者一切法律责任的权利。\n6. 如果即时设计发现或收到他人举报投诉您违反本协议或存在任何恶意行为的，即时设计有权不经通知随时对相关内容进行删除、屏蔽，并视行为情节对违规账号除以包括但不限于警告、限制或禁止使用全部或部分功能、账号封禁、注销等处罚，并公告处理结果。即时设计有权对涉嫌违反法律法规、涉嫌违法犯罪的行为保存有关记录，并依法向有关主管部门报告、配合有关主管部门调查。对已删除内容公司有权不予返还。\n7. 如您违反法律法规或本条款、补充条款，即时设计将作出独立判断立即暂停或终止您的服务帐号。您需自行对其全部行为承担法律责任，我们不承担任何法律责任。相关国家机关或机构、我们、第三方可能会对您提起诉讼、罚款或采取其他制裁措施，您应独立承担相关责任，造成损害的，您应依法予以赔偿。如因此导致我们遭受损失的，您也应当一并赔偿。\n8. 用户必须为自己注册帐号下的一切行为负责，包括所发表的任何内容以及由此产生的任何后果。用户应对本服务中的内容自行加以判断，并承担因使用内容而引起的所有风险，包括因对内容的正确性、完整性或实用性的依赖而产生的风险。同时用户应对自行发布在即时设计平台的内容（包括设计稿、设计规范、素材库、图标库等）进行权利保证并对诸如存在版权瑕疵等问题承担责任。即时设计无法且不会对因前述风险而导致的任何损失或损害承担责任。\n\n## 四、内容相关规则\n\n1. 您发布的资源内容（包括但不限于网页、文字、图片、音频、视频、图表等）必须是您自己创作或您有权许可他人使用的作品。请确保您发布的资源内容不会侵犯任何第三方权益，包括但不限于任何知识产权或隐私权。\n2. 您在本平台上发布“原型作品”、“设计作品”等原创资源内容，著作权本平台将均视为归您本人所有。您可授权第三方以任何方式使用，不需要得到我们的同意。如您的作品中有他人授权的作品内容或含有临摹仿照他人作品内容的部分，作为内容的发布者，您需自行对所发布的内容负责，引发的一切纠纷，由您自行承担法律责任。\n3. 为了保障您的合法权益，建议您不要发布任何不希望别人使用的资源内容。如果您对使用者有特殊的限制，请在发布资源时，在内容或描述中标明您允许的使用方式，以供其他使用者在使用时进行参考。平台在您发布您的资源内容后，平台将允许其他用户对该资源内容进行查看、复制、编辑和保存在内的一系列使用行为；但平台无法对使用该资源内容的其他用户进行使用方式和使用范围及用途上的限制。\n4. 为了促进您创作内容的分享和传播，您通过本平台发表的公开资源，我们将视为您同意「署名 4.0 国际 (CC BY 4.0)」知识共享许可协议，并授予我们免费的、全球的、不可撤销的非独家使用许可，我们有权将内容用于各种形态开发、运营产品和服务上。\n5. 如果任何第三方侵犯了您在本平台的相关权利，您同意授权本平台或其指定的代理人代表您本人或本平台对该第三方提出警告、投诉、发起行政执法、诉讼、进行上诉（但非义务），或谈判和解，并且您同意在本平台认为必要的情况下参与共同维权。\n6. 如我们发现或收到他人举报您发布的内容违反法律法规或本协议约定的，我们有权进行独立判断并采取技术手段予以删除、屏蔽或断开链接。同时有权视您的行为性质，采取包括但不限于暂停或终止服务，限制、冻结或终止帐号使用，追究法律责任等措施。\n7. 在没有获得著作权人或其代理人的许可之前，您不能使用平台上的资源内容，也不能通过“右键--保存”、截屏或其他技术方式复制和保存他人作品。\n8. 平台功能服务中出现的示例图片、资源内容以及内容中含有的字体、商标、肖像等其他权利，为第三方所有，未授权平台用户使用。我们不是授予您许可的一方，也不是此许可的一方，任何商业用途均须联系著作权人或其代理人获取授权，按照获取的许可进行使用。\n9. 某些资源中可能包含原作者在其他途径获取的素材（包括但不限于字体、图片、组件），并且这些素材可能存在不同的许可协议。建议您在使用之前，通过阅读资源内容、描述页中标识说明或与联系作者了解具体情况。如因为使用平台上其他用户发布的资源内容而给您带来的纠纷、赔偿及其他一系列的法律问题，均由您和相关第三方自行解决；平台在提供告知义务后，不承担任何相关的法律责任，亦不承担其他任何的保证或保障。\n\n## 五、实名认证\n\n1. 根据《中华人民共和国网络安全法》规定，网络运营者在为用户提供需要使用信息发布、即时通讯等服务时，应当要求用户提供真实身份信息。\n2. 如果您需要使用「资源发布」及广场「评论」服务，请在「账号设置」中绑定个人手机号完成实名认证，实名认证不会对您使用即时设计造成任何影响，您的所有个人信息将按照我们的隐私政策进行保障。\n\n## 六、隐私政策\n\n1. 保护您的个人隐私是我们的一项基本原则。\n2. 您在注册帐号或使用本服务的过程中，可能需要填写一些必要的信息。请保持这些信息的及时更新，以便我们向您提供帮助，或更好地为您提供服务。若国家法律法规有特殊规定的，您需要填写真实的身份信息。若您填写的信息不完整，则无法使用本服务或在使用过程中受到限制。\n3. 一般情况下，您可随时浏览、修改自己提交的信息，但出于安全性和身份识别（如号码申诉服务）的考虑，您可能无法修改注册时提供的初始注册信息及其他验证信息。\n4. 我们将运用各种安全技术和程序建立完善的管理制度来保护您的个人信息和数据安全，以免遭受未经授权的访问、使用或披露。\n5. 除以下情形外，我们不会将您的个人信息、数据转移或披露给任何非关联的第三方：\n- 相关法律法规或法院、政府机关要求；\n- 为完成合并、分立、收购或资产转让而转移；\n- 为提供您要求的服务所必需；\n- 事先获得您明确的同意或授权。\n6. 有关隐私保护的政策，请您仔细阅读《即时设计隐私协议》。\n\n## 七、数据安全\n\n1. 保护您的数据安全是我们的一项基本原则。\n2. 我们将尽力保护您使用本平台产品服务产生的数据，并为此采取合理的数据传输、存储、转换等预防保护措施。但是，互联网数据传输、存储、转换均可能存在一定未知且不确定的数据安全风险，该等风险将导致包括但不限于数据丢失、泄露、损坏、无法读取或提取等后果。您确认，您已明确知晓并同意接受该等因互联网引发的风险和后果，并已采取恰当的措施，以便在该等风险发生时将损失降至最低。\n3. 因互联网技术本身等非我们主观故意或重大过失导致危害您数据安全的，我们不承担任何赔偿责任。因我们重大过失危害您数据安全的，我们的赔偿责任以向您收取的服务费用为上限。\n\n## 八、知识产权声明\n\n1. 本网站上所有内容，包括但不限于著作、图片、档案、资讯、资料、网站架构、网站画面的安排、网页设计，均由本网站依法拥有其知识产权，包括但不限于商标权、专利权、著作权、商业秘密等。\n2. 任何人不得擅自使用、修改、反向编译、复制、公开传播、改变、散布、发行或公开发表本网站程序或内容。\n3. 尊重知识产权是您应尽的义务，如有违反，您应承担相应的法律责任和赔偿。\n\n## 九、字体授权协议\n\n1. 确认导入字体后，即表示您有该字体的商用授权，在商用 / 非商用项目中均可该字体。\n2. 在项目中使用导入字体时，即表示您默认同意将该字体的商用授权，授权给在当前项目中有预览权限、下载权限、编辑权限的成员使用。\n3. 在项目中使用导入字体时，即表示您默认同意将该字体的商用授权，授权给下载、复制（或通过其他手段拷贝）当前项目后的文件继续使用。\n4. 如果您不同意第 ① 项条款时，请将该项字体在当前面板或个人字体管理面板中进行移除。\n5. 如果您不同意第 ②、③ 项条款，请在文件字体管理面板中，取消该字体授权。\n6. 勾选「我有以上字体的商用授权」选项后，即表示您理解并同意以上条款内容，我们对于与本条款有关或由本条款引起的任何间接的、惩罚性的、特殊的、派生的损失或版权问题等（包括但不限于业务损失、收益损失、利润损失、商誉或其他经济利益的损失)，不论是如何产生的，也不论是由对本条款的违约还是由侵权造成的，均不承担任何责任。\n\n## 十、博客文章发布服务协议\n\n1. 确认发布作品，即表示您确认本人为该作品的版权所有者，拥有该作品的完整版权。\n2. 表示您同意并认可「署名 4.0 国际 (CC BY 4.0)」知识共享许可协议。\n3. 您发布版权非本人所有的作品时，对版权所有者及其他使用该作品用户造成的任何直接或间接损失（包括但不限于业务损失、收益损失、利润损失、商誉或其他经济利益的损失）及版权等相关法律问题，都由您本人承担和负责。\n\n## 十一、收费服务\n\n1. 如您使用本平台的收费服务项目，请遵守相关的条款并按期足额支付费用。\n2. 我们可能根据实际需要对收费服务的收费标准、方式进行修改和变更，我们也可能会对部分免费服务开始收费。前述修改、变更或开始收费前，我们将在相应服务页面进行通知或公告。如您不同意上述修改、变更或付费内容，则应停止使用该服务。\n\n## 十二、 不可抗力与其他免责事由\n\n1. 由于不可抗力事件导致用户遭受损失的，我们不承担责任。不可抗力事件包括但不限于：\n- 自然灾害、如台风、洪水、冰雹；\n- 政府行为，如征收、征用；\n- 社会异常事件，如罢工、骚乱；\n- 计算机病毒或黑客攻击、互联网络、通信线路等原因造成的服务中断。\n2. 您理解并同意，在使用本服务的过程中，可能会遇到网络信息或其他用户行为带来的风险，我们不对任何信息的真实性、适用性、合法性承担责任，也不对因侵权行为给您造成的损害负责。这些风险包括但不限于：\n- 来自他人匿名或冒名的含有威胁、诽谤、令人反感或非法内容的信息；\n- 因使用本条款项下的服务，遭受他人误导、欺骗或其他导致或